import React from 'react';
import CartItem from "./CartItem";

export default function CartList({value}) {
	const {cart} = value;
	return (
    <div className="container-fluid d-md-block">
      {cart.map(item => (
        <CartItem  key={item.id}  />
      ))}
    </div>
  );
}
